import{_ as o,a,b as r,c as t}from"./chunks/rtk_holybro_h-rtk-f9p_spec.BNqL4kUJ.js";import{_ as s}from"./chunks/rtk_holybro_h-rtk_mount_3.o-xCr925.js";import{_ as i,c as l,a8 as h,o as p}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"Holybro H-RTK F9P GNSS","description":"","frontmatter":{},"headers":[],"relativePath":"ko/gps_compass/rtk_gps_holybro_h-rtk-f9p.md","filePath":"ko/gps_compass/rtk_gps_holybro_h-rtk-f9p.md"}'),n={name:"ko/gps_compass/rtk_gps_holybro_h-rtk-f9p.md"};function c(m,e,d,f,b,u){return p(),l("div",null,e[0]||(e[0]=[h('<h1 id="holybro-h-rtk-f9p-gnss" tabindex="-1">Holybro H-RTK F9P GNSS <a class="header-anchor" href="#holybro-h-rtk-f9p-gnss" aria-label="Permalink to &quot;Holybro H-RTK F9P GNSS&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><a href="./../dronecan/holybro_h_rtk_zed_f9p_gps.html">Holybro H-RTK ZED-F9P Rover</a> is an upgraded version of this module.</p></div><p>The <a href="https://holybro.com/products/h-rtk-f9p-gnss-series" target="_blank" rel="noreferrer">Holybro H-RTK F9P GNSS</a> is an multi-band high-precision <a href="./../gps_compass/rtk_gps.html">RTK GNSS System</a> series launched by Holybro. This family is similar to the <a href="./../gps_compass/rtk_gps_holybro_h-rtk-m8p.html">H-RTK M8P</a> series, but uses multi-band RTK with faster convergence times and reliable performance, concurrent reception of GPS, GLONASS, Galileo and BeiDou, and faster update rate for highly dynamic and high volume applications with centimeter-accuracy. u-blox F9P 모듈, IST8310 나침반과 3색 LED 표시기를 사용합니다. 또한, 간단하고 편리하게 작동할 수 있는 통합 안전 스위치가 있습니다.</p><p>Holybro H-RTK F9P에는 세 가지 모델이 있으며, 각 모델은 다른 요구 사항을 충족하기 위하여 각각 다른 안테나 설계를 사용합니다. Refer to <a href="#specification-and-model-comparison">Specification and Model Comparison section</a> for more details.</p><p>Using RTK allows PX4 to get its position with centimetre-level accuracy, which is much more accurate than can be provided by a normal GPS.</p><p><img src="'+o+'" alt="h-rtk"></p><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><ul><li><a href="https://holybro.com/products/h-rtk-f9p-gnss-series" target="_blank" rel="noreferrer">H-RTK F9P (Holybro Website)</a></li><li><a href="https://holybro.com/collections/h-rtk-gps" target="_blank" rel="noreferrer">H-RTK Accessories (Holybro Website)</a></li></ul><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>RTK setup and use on PX4 via <em>QGroundControl</em> is largely plug and play (see <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> for more information).</p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p>H-RTK Helical models come with both GH 10-pin &amp; 6-pin cables that are compatible with the GPS1 &amp; GPS2 ports on flight controllers that use the Pixhawk Connector Standard, such as <a href="./../flight_controller/pixhawk4.html">Pixhawk 4</a> and <a href="./../flight_controller/pixhawk5x.html">Pixhawk 5x</a>.</p><p>The H-RTK Rover Lite comes in two version. The standard version comes with 10 pin connector for the <code>GPS1</code> port. The &quot;2nd GPS&quot; version comes with 6 pin connector for the <code>GPS2</code> port. This is used as a secondary GPS for <a href="./../gps_compass/#dual_gps">Dual GPS Systems</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The cables/connectors may need to be modified in order to connect to other flight controller boards (see <a href="#pin-map">Pin Map</a> below).</p></div><h2 id="핀-맵" tabindex="-1">핀 맵 <a class="header-anchor" href="#핀-맵" aria-label="Permalink to &quot;핀 맵&quot;">​</a></h2><p><img src="'+a+'" alt="h-rtk-f9proverpinmap"></p><p><img src="'+r+'" alt="h-rtk-f9phelicalpinmap"></p><h2 id="사양-및-모델-비교" tabindex="-1">사양 및 모델 비교 <a class="header-anchor" href="#사양-및-모델-비교" aria-label="Permalink to &quot;사양 및 모델 비교&quot;">​</a></h2><p><img src="'+t+'" alt="h-rtk-f9pspec"></p><h2 id="gps-소품" tabindex="-1">GPS 소품 <a class="header-anchor" href="#gps-소품" aria-label="Permalink to &quot;GPS 소품&quot;">​</a></h2><p><a href="https://holybro.com/products/vertical-mount-for-h-rtk-helical" target="_blank" rel="noreferrer">H-RTK Mount (Holybro Website)</a></p><p><img src="'+s+'" alt="h-rtk"></p>',22)]))}const y=i(n,[["render",c]]);export{P as __pageData,y as default};
